*{margin:0; padding:0;}
a {text-decoration:none; outline:none}
a img {border:none}
li {list-style:none}
.clear {clear:both; overflow:hidden; line-height:0; font-size:0; height:0}
.clearfix:after{visibility:hidden;display:block;font-size:0;content:" ";clear: both;height:0}
* html .clearfix{zoom:1}
*:first-child+html .clearfix{zoom:1}
a{text-decoration:none}
input{outline:none}
html{height: 100%}
body{-webkit-text-size-adjust:100%;font-size:14px;font-family:
  montserrat-regular 
,Helvetica,sans-serif;height: 100%;background: #3a52c0 url(http://i2.cdn-image.com/__media__/pics/26874/bgimg.jpg) no-repeat center;background-size: cover;background-attachment: fixed}
.main-container{width: 1080px; margin: 0 auto;}
.contentWrap{min-height: calc(100vh - 158px)}

.popular-searches{padding: 70px 0 0;width: 580px;margin:0 auto;}
.popular-searches ul.first{  list-style: none;margin:0 auto;}
.popular-searches ul.first li{margin-bottom: 25px;-webkit-text-size-adjust: 100%;color: #ffffff;text-align: left;word-wrap: break-word; background:#1c309c url(http://i2.cdn-image.com/__media__/pics/26874/numbg.png) no-repeat  left center;background-size: 100px 100%;position: relative;width: 100%}
.popular-searches ul.first li a{font-size: 24px; color:  #fff; line-height: 28px;word-wrap: break-word;background: url(http://i2.cdn-image.com/__media__/pics/26874/sarrow.png) no-repeat  right 20px center;padding: 30px 60px 30px 130px;display: block;font-family: 
  montserrat-medium 
,arial;position: relative;border-bottom:2px solid transparent}
.popular-searches ul.first li:hover a{border-color:#ff9600}
.popular-searches .num{position: absolute;width: 100px;text-align: center;font-size: 45px;font-family: 
  montserrat-medium 
 ,Arial;letter-spacing: 1.98px;color: #fff;background: #1a2681;left: 0;top: 50%;line-height: 50px;margin-top: -25px;}
input:-webkit-autofill {
    -webkit-box-shadow: 0 0 0 1000px #3A3A3A inset !important;
}
.related-searches-custom{font-size: 16px; color: #fff; font-family:
  montserrat-regular 
,Helvetica,sans-serif; margin-bottom: 15px; display: block; word-break: break-word;}
.website{float: left;max-width: 50%;}
.website a{word-wrap: break-word; font-size: 28px;font-weight: 600;color: #fff;font-family:
  montserrat-medium 
, Arial, Helvetica, sans-serif; display:block;line-height: 32px;
    margin-top: 4px;}
.header{margin: 0px 0 0px 0;background-color: #18247d;padding: 16px 0;}

.footer {text-align:center; color:#ccc; width:100%; padding:40px 0 0}
.footer a {color:#999; font-size:11px; text-decoration:none; word-wrap: break-word;}
.footer a:hover {text-decoration:underline; color:#333}

.footer-related{text-align: center;padding: 30px 0;border-top:1px solid #db85b2;}
.footer-related a{color: #fffdff;font-size: 16px;display: inline; word-wrap: break-word;font-family: 
  montserrat-medium 
,arial;}
.footer-related a:hover{color:#180743}
.footer-related span{margin-right: 20px;color: #fff;font-size: 16px;display: inline;font-family:
  montserrat-medium 
, Arial, Helvetica, sans-serif;}
.footer-related li{display: inline; word-wrap: break-word;}
.footer-related .sepr {opacity: 0.5;color:#fff;font-size:24px;line-height: 24px;padding:0 45px;}
div.search-form{height:39px; margin:0 auto;width: 300px; background: #fff;float: right}
.srchTxt{background: transparent; border: 0px none; float: left; font-size: 16px; height: 29px; line-height: 29px; padding: 5px 10px; width: 240px;-webkit-border-radius:0;-moz-border-radius:0;border-radius:0;color: #000}
.srchBtn {background: url(http://i2.cdn-image.com/__media__/pics/26874/search-icon.png) no-repeat center center; border: none; color: #fff; cursor: pointer; float: right; font-size: 14px; height: 25px; outline: medium none; width: 25px;-webkit-appearance:none;-webkit-border-radius:0;-moz-border-radius:0;border-radius:0;text-transform: uppercase;margin: 7px 10px 0 0;}
.custom-msg {text-align: center;background-color: #fff}
.abs-msg{position: absolute; right: 5%; top: 15%; width: 180px; font-size: 12px;background:none;color: #fff}
.abs-msg a{color: #fff;text-decoration: underline}

div#optOutLink{ padding-top: 30px}
.no-results{text-align: center; padding: 10px 10px 0; color: #ffffff;font-size: 15px }


.privacy{text-align: center;padding-bottom: 10px;}
.privacy a{color:#fff;text-align: center;font-size: 11px}
.privacy a:hover{text-decoration: underline}

#trademark-footer {padding: 15px 0; text-align: center; font-size: 12px; background-color:#232a33;margin-bottom: 20px}
.trademark-foottxt a {color: #ffffff; font-size: 13px; line-height: 28px; }
.trademark-foottxt a:hover{text-decoration: underline;}


@media only screen and (max-width:1150px) {
.main-container{width: 95%}
.abs-msg{right:10px;}
}
@media only screen and (max-width:1024px) {
    .abs-msg{position: static; width: auto; top: auto; right: auto;}
}

@media only screen and (max-width:767px) {

    .website{margin:0 auto;float: none;max-width: unset;text-align: center;}
    .website a{display: inline;font-size: 24px;margin-top: 0}
    div.search-form{margin:15px auto 0;float: none;width: 280px}
    .srchTxt{width: 225px;font-size: 14px}
    .popular-searches {width: auto;padding:30px 0 0}
    .popular-searches .num{font-size: 31px;width: 67px}
    .popular-searches ul.first li{margin-bottom: 15px;background-size: 67px 100%}
    .popular-searches ul.first li a{padding: 20px 55px 20px 90px;font-size: 20px;line-height: 25px;background-size: 16px}
    .popular-searches ul.first li:hover a{background-size: 16px}
    .footer-related li{padding-bottom: 10px; display: block;text-align: left}
    .footer-related a{font-size: 15px}
    .footer-related .sepr{display: none}
    .contentWrap{min-height: auto}
    .privacy{margin-top:15px}
    ul.privacy{text-align: center}
}
